import React from 'react'

const App = () => {
  const now = new Date()
  const a = 10
  const b = 20
  const Hello = () => {
    return (
      <div>
        <p>Hello world</p>
      </div>
    )
  }

  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  )
}

export default App;
